CREATE TABLE ods.tbl_form (
    ID VARCHAR(50) NOT NULL,
    INDXNM VARCHAR(200) NOT NULL,
    FORMNM VARCHAR(200) NOT NULL,
    ITEMINDXSEQ BIGINT NOT NULL,
    SUPITEMINDXSEQ BIGINT NOT NULL,
    CNT INTEGER NOT NULL,
    EMRFLAG VARCHAR(1) NOT NULL,
    RECKIND VARCHAR(20) NOT NULL,
    SIGNNO VARCHAR(30) NOT NULL,
    LISFLAG VARCHAR(20),
    LEVL INTEGER NOT NULL,
    SECONDSORTNO BIGINT NOT NULL,
    FIRSTSORTNO BIGINT NOT NULL,
    THIRDSORTNO BIGINT NOT NULL,
    CONSTRAINT pk_tbl_form PRIMARY KEY (ID, ITEMINDXSEQ)
);

